// TimelineChart.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TimelineChart = () => {
  const [sampleData, setSampleData] = useState([]);

  useEffect(() => {
    const fetchSampleData = async () => {
        try {
          const response = await axios.get('/api/sampledata');
          setSampleData(response.data);
        } catch (error) {
          console.error('Error fetching sample data:', error);
          // Display an error message to the user or handle the error in another way
        }
      };
  }, []);

  return (
    <div>
      {sampleData.map((sample, index) => (
        <div
          key={index}
          style={{
            width: `${(sample.machine_status === 1 ? 10 : 5)}%`,
            height: '20px',
            backgroundColor: sample.machine_status === 0 ? 'yellow' : sample.machine_status === 1 ? 'green' : 'red',
            display: 'inline-block',
            marginRight: '1px',
          }}
        >
          {new Date(sample.ts).toLocaleTimeString()}
        </div>
      ))}
    </div>
  );
};

export default TimelineChart;
